import { useEffect } from "react";

export default function TestKraken() {
    useEffect(() => {
        const ws = new WebSocket("wss://ws.kraken.com");

        ws.onopen = () => {
            console.log("✅ Connected to Kraken v2");

            ws.send(JSON.stringify({
                method: "subscribe",
                params: {
                    channel: "ticker",
                    symbol: ["BTC/USD", "MATIC/USD"]
                }
            }));
        };

        ws.onmessage = (event) => {
            console.log("📩 RAW:", event.data);
        };

        ws.onclose = () => {
            console.log("❌ Disconnected from Kraken v2");
        };

        return () => ws.close();
    }, []);

    return null;
}
